import React from "react";
import useAuth from "../../context/useAuth";
import { Outlet, Navigate } from "react-router-dom";

function Guestlayout() {
  const { user } = useAuth();

  if (!user) {
    return <Outlet />;
  } else {
    <Navigate to="/dashboard" />;
  }
}

export default Guestlayout;
